Each test case exercises a minimal piece of the syscall's functionality. Each must be registered with the test_case! macro. crate::test_case! {ctime => [Regular, Fifo, Block, Char, Socket]}
fn ctime(ctx: &mut TestContext, f_type: FileType) { let path = ctx.create(f_type).unwrap(); let ctime_before = stat(&path).unwrap().st_ctime; sleep(Duration::from_secs(1)); chmod(&path, Mode::from_bits_truncate(0o111)).unwrap(); let ctime_after = stat(&path).unwrap().st_ctime; assert!(ctime_after > ctime_before);
}

