Some test cases need functions only available when they are run serialized, especially when they affect the whole process. An example is changing user (SerializedTestContext::as_user). To have access to these functions, the test should be declared with a SerializedTestContext parameter in place of TestContext and the serialized keyword should be prepended before features. For example: crate::test_case! { /// The file mode of a newly created file should not affect whether /// posix_fallocate will work, only the create args /// https://bugs.freebsd.org/bugzilla/show_bug.cgi?id=154873 affected_only_create_flags, serialized, root, FileSystemFeature::PosixFallocate
}
fn affected_only_create_flags(ctx: &mut SerializedTestContext) { ctx.as_user(Some(Uid::from_raw(65534)), None, || { let path = subdir.join("test1"); let file = open(&path, OFlag::O_CREAT | OFlag::O_RDWR, Mode::empty()).unwrap(); assert!(posix_fallocate(file, 0, 1).is_ok()); });
}
